import React from "react";
import Img from "react-optimized-image";
import style from "style/Home.module.css";
import HeroJpg from "static/homepageHero.jpg";
import HeroWebP from "static/homepageHero.webp";

const Home = () => {
  return (
    <>
      <h1>Home</h1>
      <picture className="hero">
        <source className="hero" srcSet={HeroWebP} type="image/webp" />
        <img className="hero" src={HeroJpg} alt="like button" />
      </picture>
    </>
  );
};

export default Home;
